ESP_RAM_BLOCK = 0x1800

def writeStubs(stublist,filename):
    print("Stub rocessing started..")
    line_length=80
    with open(filename,"w") as f:
        for item in stublist:
            stub = item[0]
            stub_name = item[1]
            print('Processing:',stub_name)
            f.write('var '+stub_name+'_stub = {')
            first_item=True
            for field in ['text', 'data']:
                if field in stub:
                    if first_item:
                        f.write('\n')
                        first_item=False
                    else:
                        f.write(',\n')
                    offs = stub[field + "_start"]
                    f.write( field + '_start:'+str(offs)+',\n' )
                    bytes = base64.standard_b64encode(stub[field])
                    f.write (field+':`')
                    line_pos=6
                    for b in bytes:
                        f.write(chr(b))
                        line_pos = line_pos + 1
                        if line_pos > line_length:
                            f.write('\n')
                            line_pos=0
                    f.write('`')
            
            f.write(',\nentry:'+str(stub['entry'])+'}\n')
    print("Stub processing done")

stublist = ((ESP8266ROMstub,"esp8266"),(ESP32ROMstub,"esp32rom"),(ESP32S2ROMstub,"esp32srom"))
writeStubs(stublist,"stubs.js")

